// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import './App.css';
import SignIn from './components/SignIn';
import SignUp from './components/SignUp';
import Home from './components/Home'; // We'll create this new component
import AnalysisResults from './components/AnalysisResults'; // We'll create this new component

function App() {
    // You'll need to manage the authentication state, a simple way is to use localStorage
    const isAuthenticated = localStorage.getItem('isLoggedIn');

    return (
        <Router>
            <div className="App">
                <header className="App-header">
                    <h1>Resume Analyzer</h1>
                </header>
                <Routes>
                    <Route path="/" element={isAuthenticated ? <Navigate to="/home" /> : <Navigate to="/signin" />} />
                    <Route path="/signin" element={<SignIn />} />
                    <Route path="/signup" element={<SignUp />} />
                    <Route path="/home" element={isAuthenticated ? <Home /> : <Navigate to="/signin" />} />
                    <Route path="/analysis" element={isAuthenticated ? <AnalysisResults /> : <Navigate to="/signin" />} />
                    <Route path="*" element={<h1>404 Not Found</h1>} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
